const ProductsView = () => {
  const products = useProducts();
  const { mutate } = useSWRConfig();

  const { user } = useAuth();
  console.log('user', user);
  const onSubmit = async (formControl: any) => {
    let formData = new FormData();

    formData.append('type', 'product');
    formData.append('file', formControl['image']);
    const res = await api.post('/files/upload', formData);

    const product = await api.put('/products/add', {
      description: formControl['description'],
      allergens: formControl['allergens'],
      ingredients: formControl['ingredients'],
      title: formControl['title'],
      type: formControl['type'],
      price: parseInt(formControl['price']),
      restaurantId: 1,
      imageId: res.data.id,
    });
    console.log('product', product);

    if (product.status === 200) {
      mutate('/products');
      return true;
    } else {
      return false;
    }
  };

  const onDelete = async (id: number) => {
    const achievement = await api.delete(`/products/${id}`);
    if (achievement.status === 200) {
      mutate('/products');
      return true;
    } else {
      return false;
    }
  };

  return (
    <ResponsiveDrawer>
      {products.products ? (
        <ResponsiveTable
          data={products.products}
          fields={headCells}
          actions={true}
          title={'Produtos'}
          onSubmit={onSubmit}
          onDelete={onDelete}
        />
      ) : (
        <></>
      )}
    </ResponsiveDrawer>
  );
};

export default ProductsView;
